var OfficeUICoreAPI={EnableTab:function(e){if($("#"+e).LogWhenNotFound("Tab with id '"+e+"' not found.")){OfficeUICoreHelpers.DeactivateAllTabs();OfficeUICoreHelpers.ActivateTab(e)}},EnableTabIndex:function(e){var t=$("li[role=tab]:not(.application):eq("+e+")");OfficeUICoreAPI.EnableTab($(t).attr("id"))},EnableRibbonAction:function(e){var t=$("#"+e);if($(t).LogWhenNotFound("Element with id '"+e+"' not found.")){if(OfficeUICoreHelpers.IsRibbonActionAnIcon($(t))){OfficeUICoreHelpers.EnableRibbonAction($(t))}else{console.log("The function 'EnableRibbonIcon' is only supported on icons.")}}},DisableRibbonAction:function(e){var t=$("#"+e);if($(t).LogWhenNotFound("Element with id '"+e+"' not found.")){if(OfficeUICoreHelpers.IsRibbonActionAnIcon($(t))){OfficeUICoreHelpers.DisableRibbonAction($(t))}else{console.log("The function 'DisableRibbonIcon' is only supported on icons.")}}},DisableMenuEntry:function(e){var t=$("#"+e);if($(t).LogWhenNotFound("Element with id '"+e+"' not found.")){$(t).Disable()}},Notify:function(e,t){t=$.extend({},NotifyDefault,t);$("#notificationArea").html(e);if(t.Flash){$("#notificationArea").Flash(t.Time,t.OnComplete)}}};var NotifyDefault={Time:150,Flash:true,OnComplete:function(){}}